#!/bin/sh

# asset install script used by the Magic Carpet 2 game engine
# Copyright 2023-2024  Petre Rodan <petre.rodan@subdimension.ro>
#
# ChangeLog
#   20241006:
#       make script compatible with both bash and FreeBSD's default 'sh' IEEE Std 1003.1 (“POSIX.1”) spec interpreter

usage() {
    echo ''
    echo ' the remc2 engine currently needs R/W access to most of the game asset files.'
    echo ' this is why we currently install to a directory where the user has full access.'
    echo ''
    echo 'Usage:'
    echo '   - check install'
    echo '      this mode verifies the integrity of the game assets via known checksums.'
    echo ''
    echo "      $0 -d [dest_dir]"
    echo ''
    echo '   - install base assets'
    echo '      mode that prepares all mandatory base assets by copying the files'
    echo '      from the GOG install directory or the original CD'
    echo ''
    echo "      $0 -s [src_dir] -d [dest_dir]"
    echo ''
    echo '          src_dir: GOG install dir or the device holding the Magic Carpet 2 CD'
    echo '          dst_dir: has to be the dir where remc2 will search for the game assets'
    echo ''
    echo '   - install HD assets'
    echo '      mode that installs a few optional assets \(HD textures and soundtrack\)'
    echo ''
    echo "      $0 -x -d [dest_dir]"
    echo ''
    echo '          dst_dir: has to be the dir where remc2 will search for the game assets'
    echo ''
    echo ''
    echo '  the install mode needs the "p7zip" and "bchunk" packages to be installed'
}

# config that contains a known good install dir location
conf="${HOME}/.config/remc2/game.cfg"

