mv_files() {
    entry="${1}"
    [ -z "${entry}" ] && return
    chmod 644 "${entry}"
    newentry=$(echo "${entry}" | tr '[:lower:]' '[:upper:]')
    if [ "${entry}" != "${newentry}" ] && [ -n "${newentry}" ]; then
        mv -- "${entry}" "${newentry}"
    fi
}

mv_dirs() {
    entry="${1}"
    [ -z "${entry}" ] && return
    chmod 755 "${entry}"
    newentry=$(echo "${entry}" | tr '[:lower:]' '[:upper:]')
    if [ "${entry}" != "${newentry}" ] && [ -n "${newentry}" ]; then
        mv -- "${entry}" "${newentry}"
    fi
}

GOOD=$'\e[32;01m'
BAD=$'\e[31;01m'
BRACKET=$'\e[34;01m'
NORMAL=$'\e[0m'
ENDCOL=$'\e[A'

ebegin() {
    echo -e " ${GOOD}*${NORMAL}  $*"
}

eend() {
    retval="${1:-0}"
    efunc="${2:-eerror}"

    if [ "${retval}" = "0" ] ; then
        msg="${BRACKET}[ ${GOOD}ok${BRACKET} ]${NORMAL}"
    else
        msg="${BRACKET}[ ${BAD}!!${BRACKET} ]${NORMAL} $*"
    fi
    echo -e "${ENDCOL} ${msg}"
}

cp_usr_share() {
    for loc in '/usr/share/mcarpet2' '/usr/local/share/mcarpet2'; do
        [ -e "${loc}" ] && {
            rm -rf "${1}/font"
            rm -rf "${1}/remc2"
            ln -s ${loc}/font "${1}/font"
            ln -s ${loc}/remc2 "${1}/remc2"
        }
    done
}

get_HD_assets() {
    prefix="${1}"
    cd "${prefix}" > /dev/null || return 1
    wget -q 'https://subdimension.ro/distfiles/remc2_HD.tar.bz2' -P /tmp
    tar -xf /tmp/remc2_HD.tar.bz2
    rm -f /tmp/remc2_HD.tar.bz2
    cd - > /dev/null || return 1
}

config_install_dir() {
    dir=$(realpath "${1}")
    mkdir -p "${HOME}/.config/remc2"
    if [ -e "${conf}" ]; then
        if grep -q install_dir "${conf}"; then
            sed -i~ "s|.*install_dir.*|install_dir='${dir}'|" "${conf}"
        else
            echo "install_dir='${dir}'" >> "${conf}"
        fi
    else
        echo "install_dir='${dir}'" > "${conf}"
    fi
}

check_base_inst() {
    prefix="${1}"
    err=false
    err_cnt=0

    [ -e "${prefix}/CD_Files" ] || {
        echo "${BAD}error${NORMAL}: 'CD_Files' directory not found in '${prefix}'"
        err=true
    }

    [ -e "${prefix}/GAME" ] || {
        echo "${BAD}error${NORMAL}: 'GAME' directory not found in '${prefix}'"
        err=true
    }

    ${err} && {
        usage
        exit 1
    }

    ebegin "     CD_Files directory"
    cd "${prefix}/CD_Files/" > /dev/null || exit 1

    find ./ -type d | while read -r line; do
        mv_dirs "${line}"
    done
    find ./ -type f | while read -r line; do
        mv_files "${line}"
    done

    if check_CD_Files; then
        eend
    else
        echo ''
        err_cnt=$((err_cnt + 1))
        eend 1 failed
    fi
    cd - > /dev/null || exit 1

    ebegin "     GAME directory"
    cd "${prefix}/GAME/" > /dev/null || exit 1

    find ./ -type d | while read -r line; do
        mv_dirs "${line}"
    done
    find ./ -type f | while read -r line; do
        mv_files "${line}"
    done

    if check_GAME; then
        eend
    else
        err_cnt=$((err_cnt + 1))
        eend 1 failed
    fi
    cd - > /dev/null || exit 1

    ebegin "     recode engine"
    cd "${prefix}" > /dev/null || exit 1
    if check_usr_share; then
        eend
    else
        err_cnt=$((err_cnt + 1))
        eend 1 failed
    fi
    cd - > /dev/null || exit 1

    [ "${err_cnt}" = "0" ] && config_install_dir "${prefix}"
}

check_HD_inst() {
    prefix="${1}"
    err=false
    err_cnt=0

    ebegin "     HD assets"
    cd "${prefix}" > /dev/null || return 1
    if check_HD_assets; then
        eend
    else
        eend 1 failed
    fi
    cd - > /dev/null || return 1
}

id | grep -q 'uid=0' && {
    echo "${BAD}warning${NORMAL}: $0 should NOT be run as root. use a low privilege account instead."
}

unset src
unset dst
get_HD='false'
get_speech='false'

[ $# = 0 ] && {
    usage
    exit 1
}

while [ $(( "$#" )) -gt 0 ]; do
    if [ "$1" = "-s" ]; then
        shift;
        src="$1"
        shift;
    elif [ "$1" = "-d" ]; then
        shift;
        dst="$1"
        shift
    elif [ "$1" = "-x" ]; then
        shift;
        get_HD='true'
    elif [ "$1" = "-h" ]; then
        shift;
        usage
    else
        if [ -e "$1" ]; then
            dst="$1"
        else
            echo "${BAD}error${NORMAL}: invalid destination directory"
            usage
            exit 1
        fi
        break;
    fi
done

[ -n "${src}" ] && [ ! -e "${src}" ] && {
    echo "${BAD}error${NORMAL}: invalid source directory"
    usage
    exit 1
}

# src is a directory
[ -n "${src}" ] && [ -d "${src}" ] &&  [ -n "${dst}" ] && {
    # copy over from src to dst

    [ ! -e "${dst}/speech" ] && get_speech='true'

    err=false
    # check is needed binaries exist
    7z -h > /dev/null || {
        echo "${BAD}error${NORMAL}: the 'p7zip' package needs to be installed"
        err=true
    }

    bchunk -h >/dev/null 2>&1 || {
        echo "${BAD}error${NORMAL}: the 'bchunk' package needs to be installed"
        err=true
    }

    ${err} && exit 1

    # ok copy files
    mkdir -p "${dst}" || {
        echo "${BAD}error${NORMAL}: cannot create destination directory"
        exit 1
    }
    cp -r "${src}/GAME" "${dst}"
    mkdir -p "${dst}/CD_Files"
    mkdir -p "${dst}/speech"
    if [ -e "${src}/game.gog" ] && [ -e "${src}/game.ins" ]; then
        cd "${dst}/CD_Files" > /dev/null || exit 1
        bchunk "${src}/game.gog" "${src}/game.ins" track > /dev/null
        7z x -y -bso0 track01.iso
        rm -f track01.iso
        ${get_speech} && mv -f track*.cdr ../speech/
        cd - > /dev/null || exit 1
    else
        echo "${BAD}error${NORMAL}: game.gog, game.ins are missing from '${src}'"
        exit 1
    fi

    cp_usr_share "${dst}"
    check_base_inst "${dst}"

    ${get_HD} && {
        get_HD_assets "${dst}"
        check_HD_inst "${dst}"
    }

    exit $?
}

# src is a cdrom drive
[ -n "${src}" ] &&  [ -n "${dst}" ] && echo "${src}" | grep -q '^/dev' && {

    err=false
    # check is needed binaries exist
    7z -h > /dev/null || {
        echo "${BAD}error${NORMAL}: the 'p7zip' package needs to be installed"
        err=true
    }

    bchunk -h >/dev/null 2>&1 || {
        echo "${BAD}error${NORMAL}: the 'bchunk' package needs to be installed"
        err=true
    }

    cdrdao disk-info --device "${src}" >/dev/null 2>&1 || {
        echo "${BAD}error${NORMAL}: the 'cdrdao' package needs to be installed"
        err=true
    }

    ${err} && exit 1

    # ok copy files
    mkdir -p "${dst}" || {
        echo "${BAD}error${NORMAL}: cannot create destination directory"
        exit 1
    }
    mkdir -p "${dst}/CD_Files"
    mkdir -p "${dst}/GAME/NETHERW/CDATA"
    mkdir -p "${dst}/GAME/NETHERW/CLEVELS"
    mkdir -p "${dst}/GAME/NETHERW/LANGUAGE"
    mkdir -p "${dst}/GAME/NETHERW/SAVE"
    mkdir -p "${dst}/GAME/NETHERW/SHOTS"
    mkdir -p "${dst}/GAME/NETHERW/SOUND"
    mkdir -p "${dst}/speech"

    cd "${dst}" > /dev/null || exit 1
    cdrdao read-cd --device "${src}" --read-raw --datafile image.bin image.toc
    toc2cue image.toc image.cue
    cd - > /dev/null || exit 1

    cd "${dst}/CD_Files" > /dev/null || exit 1
    bchunk ../image.bin ../image.cue track
    7z x -y -bso0 track01.iso
    rm -f track01.iso
    mv -f track*.cdr ../speech/
    cd - > /dev/null || exit 1

    rm -f image.bin image.cue image.toc

    cp -f "${dst}/CD_Files/DATA/TMAPS"* "${dst}/GAME/NETHERW/CDATA/"
    cp -f "${dst}/CD_Files/LEVELS/"* "${dst}/GAME/NETHERW/CLEVELS/"
    cp -f "${dst}/CD_Files/SOUND/"* "${dst}/GAME/NETHERW/SOUND/"
    rm -f "${dst}/GAME/NETHERW/SOUND/*.DAT"

    cp_usr_share "${dst}"
    check_base_inst "${dst}"

    ${get_HD} && {
        get_HD_assets "${dst}"
        check_HD_inst "${dst}"
    }

    exit $?
}

# just install the HD assets
[ -e "${dst}" ] && ${get_HD} && {
    get_HD_assets "${dst}"
    check_HD_inst "${dst}"
    exit $?
}

[ -n "${dst}" ] && [ ! -e "${dst}" ] && {
    echo "${BAD}error${NORMAL}: destination directory '${dst}' can't be accessed "
    exit 1
}

[ -n "${dst}" ] && [ -e "${dst}" ] && {
    check_base_inst "${dst}"
    [ $? != 0 ] && exit 1
    [ -e "${dst}/biggraphics" ] && {
        check_HD_inst "${dst}"
        [ $? != 0 ] && exit 1
    }
    exit 0
}

